script: |
  super -f text -I q9939.spq | sort > q9939.out

inputs:
  - name: q9939.spq
    data: |
      SELECT + 64 * + col1 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE col1 + + col1 * - + col0 + col1 * 11 * - ( + col1 ) / + col0 IS NOT NULL;
  - name: tab2

outputs:
  - name: q9939.out
    data: |
      3264
      4288
      4928
